package com.qhc.system.domain;import java.io.Serializable;import java.util.ArrayList;import java.util.List;/** *  * Function: Data transfer object. <br>  * * @author walker */public class MenusDto implements Serializable {	private static final long serialVersionUID = 1L;	/* code */	private String code = null;	/* Name */	private String name = null;	/* childs */	private List<String> childs = new ArrayList<String>();	public String getCode() {		return code;	}	public void setCode(String code) {		this.code = code;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public List<String> getChilds() {		return childs;	}	public void setChilds(List<String> childs) {		this.childs = childs;	}}